var PasswordsMatch=function(b,c,d){var a=this;this.m_password=b;this.m_passwordConfirmation=c;this.m_errorMessage=d;this.m_password.addEventListener("keyup",function(){a.passwordsMatch()},!1);this.m_passwordConfirmation.addEventListener("keyup",function(){a.passwordsMatch()},!1)};
PasswordsMatch.prototype.passwordsMatch=function(){""===this.m_password.value||""===this.m_passwordConfirmation.value?this.m_passwordConfirmation.setCustomValidity(""):this.m_password.value===this.m_passwordConfirmation.value?this.m_passwordConfirmation.setCustomValidity(""):this.m_passwordConfirmation.setCustomValidity(this.m_errorMessage)};
